import React from 'react';
import './images.css';
import ImageContext from './UrlImages'

const Images = () => {
  const context = useContext(ProfileContext);
  return (
    <div className="profile">
      <img src={context.companyImage}/>
      <User />
    </div>
  )
}

export default Images;
